import React, {Component,useState,useContext,useEffect} from 'react';
import {
  View,
  Dimensions,
  Modal,
  Text,
  Pressable,
  Linking,
  ScrollView,
  Image,
  StyleSheet,
  TouchableOpacity
} from 'react-native';
import {
  widthPercentageToDP as wp,
  heightPercentageToDP as hp,
  listenOrientationChange as loc,
  removeOrientationListener as rol
} from 'react-native-responsive-screen';
import { ScaledSheet } from 'react-native-size-matters';
import {Context as AuthContext} from '../context/AuthContext';
import Modell from './Modell';

export default class Headerr extends React.Component { 
  constructor(props) {
    super(props);   
  }
  
  render() {
    return (
      <View  style={styles.temT}>
        <TouchableOpacity style={styles.image1} onPress={this.props.onPress}>
          <Image source={require('../images/logout.png')} />
        </TouchableOpacity> 
        <Image source={require('../images/icone.png')} style={styles.imagei}/>
        <Text style={styles.temText}>AGROTECH SMART IRRIGATION APP</Text>
        <Modell/>
      </View>
    );  
  }
} 

const styles = ScaledSheet.create({
  temT: {
    marginTop:hp("7%"),
    alignSelf:"center",
    flexDirection: 'row',
    alignContent:'center',
  },
  image1:{
    marginLeft: wp("5%"),
    marginRight: wp("3%"),
  },
  temText: {
    fontSize: 16,
    textAlign:"center",
    color:'#FFFFFF',
    marginBottom: hp("2%"),
    fontFamily:'adobe-arabe',
  },
  imagei:{
    //marginLeft:"13.4%",
    width:'22@s',
    height: '22@vs',
    // marginRight:"-20%"
  },
})
